import React , {useEffect} from 'react'
import './Navbar.css';
import { NavLink  } from 'react-router-dom';
import { FaFutbol } from "react-icons/fa";
import { GiClawSlashes, GiTrophyCup } from "react-icons/gi";
import { FaClipboardList } from "react-icons/fa";
import { AiFillProfile } from "react-icons/ai";
import { IoBarChartSharp } from "react-icons/io5";
import { RiContactsBookFill } from "react-icons/ri";
import {CgMenuRound} from 'react-icons/cg' ;
import {useState} from 'react' ;

function Navbar() {

const [open, setOpen] = useState(false);

  return (


    

    <nav >
<div className='navbar'>

      <NavLink className="navbar-brand-navbar-logo" to="/" exact>
      <FaFutbol/>  دوري الحريف
      </NavLink>

        <NavLink className="sandwich" to="/" exact>
          <CgMenuRound  size='20px'   
          onClick={() => setOpen(!open) } />
        </NavLink>
              
       {open}
          <ul >

              <li className="nav-item">
                  <NavLink className="nav-link" to="/الملاعب" exact>
                    <AiFillProfile/>   الملاعب
                       
                  </NavLink> 
                 </li>

              <li className="nav-item active">
                <NavLink className="nav-link" to="/البطولات" exact>
                  < GiTrophyCup /> البطولات
                </NavLink>
              </li>
  
              <li className="nav-item">
                <NavLink className="nav-link" to="/Matches" exact>
                <FaClipboardList/> المباريات
                </NavLink> 
              </li>

              

              <li className="nav-item">
                <NavLink className="nav-link" to="/الأحصائيات" exact>
                <IoBarChartSharp/> الأحصائيات
                </NavLink> 
              </li>
  
             
              
              <li className="nav-item">
                <NavLink className="nav-link"  to="/contact" exact>
                <RiContactsBookFill/> Contact Us
                </NavLink>
              </li>
          </ul>
        </div>
    </nav>
    )
}

export default Navbar;
